// material-ui

import {
    Drawer,
    Fab,
    FormControl,
    FormControlLabel,
    Grid,
    IconButton,
    Radio,
    RadioGroup,
    Slider,
    Tooltip,
    Typography
} from '@mui/material';
// project imports
import MainCard from 'ui-component/cards/MainCard';

// ==============================|| SAMPLE PAGE ||============================== //

const Plans = () => (
    <Grid container spacing={2}>
        <Grid item xs={4}>
            <MainCard title="Plan #1">
                <Typography
                    variant="body2"
                    style={{
                        // increase height
                        height: '100%'
                    }}
                >
                    Plan Details
                </Typography>
            </MainCard>
        </Grid>
        <Grid item xs={4}>
            <MainCard title="Plan #2">
                <Typography variant="body2">Plan Details</Typography>
            </MainCard>
        </Grid>
        <Grid item xs={4}>
            <MainCard title="Plan #3">
                <Typography variant="body2">Plan Details</Typography>
            </MainCard>
        </Grid>
    </Grid>
);

export default Plans;
